import React from "react";
import { TwitterTimelineEmbed } from "react-twitter-embed";
import InstagramEmbed from "react-instagram-embed";

const News = () => {
  return (
    <section className="news">
      <div className="container">
        <div className="row">
          <div className="">
            <TwitterTimelineEmbed
              sourceType="profile"
              screenName="saradiqsa"
              theme="light"
              noHeader="true"
              noBorders="true"
              noFooter="true"
              options={{ height: 420 }}
            ></TwitterTimelineEmbed>
          </div>
          <div className="">
            <InstagramEmbed
              url="https://www.instagram.com/saradiqsa/?hl=en"
              maxWidth={320}
              hideCaption={false}
              containerTagName="div"
              protocol=""
              injectScript
              onLoading={() => {}}
              onSuccess={() => {}}
              onAfterRender={() => {}}
              onFailure={() => {}}
            />
          </div>
        </div>
      </div>
    </section>
  );
};

export default News;
